}} [ ["en", "English"], ["es-ES", "Spanish (Spain)", "auto"]
] The languages file must expose an array of arrays with the structure: [ // Code, Name, "ltr"/"rtl"/"auto" (optional) ["code", "Language name", "Writing direction"],
