use leptos::*;
use leptos_fluent::{expect_i18n, leptos_fluent, move_tr, Language}; static_loader! { pub static TRANSLATIONS = { locales: "./locales", fallback_language: "en", };
} #[component]
pub fn App() -> impl IntoView { leptos_fluent! {{ translations: [TRANSLATIONS], locales: "./locales", }}; view! { <LanguageSelector/> }
} #[component]
fn LanguageSelector() -> impl IntoView { // Use `expect_i18n()` to get the current i18n context: let i18n = expect_i18n(); view! { <p>{move_tr!("select-a-language")}</p> <fieldset> {move || { i18n.languages.iter().map(|lang| render_language(lang)).collect::<Vec<_>>() }} </fieldset> <p> {move_tr!( "language-selected-is", { "lang" => i18n.language.get().name } )} </p> }
} fn render_language(lang: &'static Language) -> impl IntoView { // Passed as atrribute, `Language` is converted to their code, // so `<input id=lang` becomes `<input id=lang.id.to_string()` view! { <div> <label for=lang>{lang.name}</label> <input id=lang value=lang name="language" checked=lang.is_active() on:click=move |_| lang.activate() type="radio" /> </div> }
} // src/main.rs
